pragma solidity ^0.4.23;

import "./Developer.sol";

contract Company {

    event GotRating(address _dev, string _skill, uint _rating);
    event Debug(uint count);

    uint callCounter;

    address[] public developers;
    Developer public developer;

    constructor(Developer _developer, address[] _developers) public {
        developer = _developer;
        developers = _developers;
    }

    function getTotalRating(string _skill) public returns (uint _totalRating) {
        emit Debug(_developers.length);
        ++callCounter;
        address[] memory _developers = developers;
        emit Debug(_developers.length);
        emit Debug(developers.length);
        for (uint _devIdx = 0; _devIdx < _developers.length; ++_devIdx) {
            uint _rating;
            (, _rating) = developer.skillDetails(_developers[_devIdx], _skill);
            emit GotRating(_developers[_devIdx], _skill, _rating);
            _totalRating += _rating;
        }

        emit Debug(_totalRating);
    }

}
